window.bookSummaryJSON = "<p>Don't miss book three in the #1 <i>New York Times</i> best-selling Maze Runner series, soon to be a major motion picture starring Dylan O'Brien! </p> <p>WICKED has taken everything from Thomas: his life, his memories, and now his only friends — the Gladers. But it's finally over. The trials are complete, after one final test. </p> <p>What WICKED doesn't know is that Thomas remembers far more than they think. And it's enough to prove that he can't believe a word of what they say. </p> <p>Thomas beat the Maze. He survived the Scorch. He'll risk anything to save his friends. But the truth might be what ends it all. </p> <p>The time for lies is over. </p> <p>The first two books, <i>The Maze Runner</i> and <i>The Scorch Trials</i>, are also #1 worldwide blockbuster movies featuring the star of MTV's <i>Teen Wolf</i>, Dylan O'Brien; Kaya Scodelario; Aml Ameen; Will Poulter; and Thomas Brodie-Sangster! </p> <p>Also look for <i>The Fever Code</i>, the much-buzzed-about series conclusion that finally reveals the story of how the maze was built, and James Dashner's other best-selling series, the <i>Mortality Doctrine: The Eye of Minds</i>, <i>The Rule of Thoughts</i>, and <i>The Game of Lives</i>. </p> <p>Praise for James Dashner and the Maze Runner series: </p> <p> A #1 <i>New York Times</i> Best-selling Series </p> <p>A<i> USA Today</i> Best Seller </p> <p>A <i>Kirkus Reviews</i> Best Teen Book of the Year </p> <p>An ALA-YASLA Best Fiction for Young Adults Book </p> <p>An ALA-YALSA Quick Pick </p> <p>“[A] mysterious survival saga that passionate fans describe as a fusion of <i>Lord of the Flies, The Hunger Games</i>, and <i>Lost</i>.” (<i>EW</i>) </p> <p>“Wonderful action writing — fast-paced . . . but smart and well observed.” (<i>Newsday)</i> </p> <p>“[A] nail-biting must-read.” (<i>Seventeen</i>)</p> <p>“Breathless, cinematic action.” (<i>Publishers Weekly</i>) </p> <p>“Heart-pounding to the very last moment.” <i>(Kirkus Reviews)</i></p> <p>“Exclamation-worthy.” (<i>Romantic Times</i>)</p> <p>“Take a deep breath before you start any James Dashner book.” (<i>Deseret News</i>)</p>"; 
